<h2 id="3.1">3.1. Indústria cerâmica</h2>
<h3>3.1.1. Introdução</h3>
<p>Os primeiros registros do uso de materiais cerâmicos são milenares e remetem ao antigo Egito e a China, há cerca de 5000 anos a.C. Dentre os antigos fragmentos cerâmicos encontrados por arqueólogos, podemos destacar a cerâmica vidrada que trazia o nome do rei Mens do Egito e o túmulo do imperador Qin Shihuang e seus soldados de terracota. Outras civilizações que apresentaram registros importantes na história da cerâmica foram os assírios (século VI a.C.) e os babilônios que utilizavam a cerâmica com ladrilhos esmaltados em azul, cinza azulado e creme e ainda relevos decorados, bem como os Persas com sua fabricação de objetos em argila cozida em alto brilho, e das cores obtidas misturando óxido metálico, método usado ainda nos dias de hoje. Com o tempo, a cerâmica foi evoluindo e ganhando os nossos dias, mas não sem contar com os esforços dos Gregos, Romanos, Chineses, Ingleses, Italianos, Franceses, Alemães e Americanos, que apesar de possuírem uma tecnologia em decoração avançada para a época, apresentavam uma produção basicamente artesanal. </p>
<p>Assim, por muitos séculos os materiais cerâmicos foram sinônimos de produtos luxuosos e exclusivos. Contudo, após a Segunda Guerra Mundial, a produção de produtos cerâmicos, tais como a lajotas e os azulejos, apresentou um desenvolvimento industrial considerável com o advento das técnicas de produção. A possibilidade de produzir em escala industrial baixou os preços e os tornou acessíveis a grande parte da população. Na fase final desse período, os revestimentos cerâmicos foram usados principalmente para satisfazer necessidades funcionais, tais como de higiene e de limpeza e desse modo, empregados em banheiros e cozinhas. Com a evolução rápida do processo produtivo, a cerâmica passou a ser uma opção para outros ambientes domésticos.</p>
<p>No Brasil o uso de materiais cerâmicos teve início no Século XVII, com a importação de azulejos em estilo barroco de Lisboa. Esse uso se intensificou no Século XIX, devido à dependência cultural, econômica e política com Portugal. Do mesmo modo que Portugal, no Brasil o revestimento cerâmico tinha um alto custo, sendo aplicado, em sua maioria, nos interiores.</p>
<p>Atualmente, o Brasil é um grande produtor de revestimento cerâmico e a indústria cerâmica brasileira tem grande importância para o país, tendo participação no Produto Interno Bruto (PIB) da ordem de 1,0%. A cada dia a qualidade e a variedade desse material crescem, revestindo pisos e paredes de todos os espaços internos e externos. Deste modo, convencionou-se definir o setor cerâmico em segmentos que se diferenciam pelos produtos obtidos e mais precisamente pelos mercados que estão inseridos. A seguir são listados os principais segmentos, classificados pelo valor anual de sua produção:</p>
<ul class="indentacao">
    <li> Cerâmica estrutural (vermelha)</li>
    <li> Revestimentos (pisos e azulejos)</li>
    <li> Matérias-primas naturais</li>
    <li> Refratários</li>
    <li> Cerâmicas técnicas e especiais </li>
    <li> Sanitários</li>
    <li> Louça de mesa e adorno</li>
    <li> Fritas, vidrados e corantes</li>
    <li> Matérias-primas sintéticas</li>
    <li> Cerâmica elétrica</li>
    <li> Equipamentos para cerâmica</li>
    <li> Abrasivos </li>
</ul>

<h3>3.1.2. Principais matérias-primas</h3>
<p>Várias são as matérias-primas usadas na produção dos diversos seguimentos da indústria cerâmica, no entanto, a argila, o feldspato e a areia são as principais matérias usadas na fabricação dos produtos clássicos. </p>
<p>As argilas são silicatos de alumínio hidratados, formados pela ação do intemperismo nas rochas ígneas. Elas podem ser encontradas próximo de rios, muitas vezes formando barrancos nas margens e apresenta-se nas cores branca e vermelha. A argila forma uma família de minerais filossilicáticos hidratados, aluminosos de baixa cristalinidade e diminutas dimensões (partículas menores do que 1/256 mm ou 4 µm de diâmetro), composta pela caulinita <span class="nobreak">(Al<sub>2</sub>O<sub>3</sub>·2SiO<sub>2</sub>·2H<sub>2</sub>O)</span>, montmorillonita <span class="nobreak">((Mg, Ca)O·5SiO<sub>2</sub>·nH<sub>2</sub>O)</span>, ilitas (<span class="nobreak">K<sub>2</sub>O</span>, <span class="nobreak">MgO</span>, <span class="nobreak">Al<sub>2</sub>O<sub>3</sub></span>, <span class="nobreak">SiO<sub>2</sub></span>, <span class="nobreak">H<sub>2</sub>O</span> todas em proporções variáveis), dentre outras. Apresentam-se geralmente estáveis, nas condições termodinâmicas e geoquímicas da superfície e terrestre ou da crosta rasa. </p>
<p>Do ponto de vista cerâmico, as argilas são plásticas e moldáveis quando suficientemente fragmentadas e úmidas. Por outro lado, são rígidas quando secas, e vitrosas quando queimadas em temperaturas elevadas. Em quase todas as argilas usadas na indústria de cerâmica, o mineral básico é a caulinita, embora às vezes se use a bentonita, cuja base é a montmorillonita, quando se deseja uma maior plasticidade. Como as argilas apresentam uma grande variação de suas propriedades físicas e na quantidade de impurezas (quantidades variáveis de feldspato, quartzo, óxidos de ferro, etc.) que contém, é necessário realizar um processo de beneficiamento das mesmas.</p>
<p>Geralmente, esse beneficiamento refere-se a operações unitárias de natureza física, tais como a separação granulométrica por peneiramento ou decantação seletiva, filtração e secagem. A purificação química também pode ser usada para produzir materiais de elevada pureza, como a alumina e o óxido de titânio.</p>
<p>O feldspato é o principal fundente empregado nas formulações cerâmicas. Ele pode estar presente na argila da jazida, ou pode ser adicionado conforme a necessidade. Os três tipo mais comuns de feldspatos usados na produção de produtos cerâmicos são os potássicos <span class="nobreak">(K<sub>2</sub>O·Al<sub>2</sub>O<sub>3</sub>·6SiO<sub>2</sub>)</span>, os sódicos <span class="nobreak">(Na<sub>2</sub>O·Al<sub>2</sub>O<sub>3</sub>·6SiO<sub>2</sub>)</span> e os cálcicos <span class="nobreak">(CaO·Al<sub>2</sub>O<sub>3</sub>·6SiO<sub>2</sub>)</span>. A seguir, tem-se a reação química de formação da caulinita a partir de um feldspato potássico:</p>

<!-- (isabela) coloquei fórmula por enquanto -->
<div class="box-centro">
    <div class="formula longa">
        <div class="line">
            <p>K<sub>2</sub>O·Al<sub>2</sub>O<sub>3</sub>·6SiO<sub>2</sub> + CO<sub>2</sub> + 2H<sub>2</sub>O → K<sub>2</sub>CO<sub>3</sub> + Al<sub>2</sub>O<sub>3</sub>·2SiO<sub>2</sub>·2H<sub>2</sub>O + 4SiO<sub>2</sub></p>
            <span class="box-eq">equação 3.1</span>
        </div>
    </div>
</div>

<p>Por fim, o terceiro constituinte principal dos produtos cerâmicos é a areia ou sílica <span class="nobreak">(SiO<sub>2</sub>)</span>. Segundo a NBR 7211/83, a areia divide-se, granulometricamente, em:</p>
<ul class="indentacao">
    <li> Areia muito fina (entre 0,15 mm e 0,6 mm);</li>
    <li> Areia fina (entre 0,6 mm e 1,2 mm);</li>
    <li> Areia média (entre 1,2 mm e 2,4 mm);</li>
    <li> Areia grossa (entre 2,4 mm e 4,8 mm).</li>
</ul>
<div class="box">
    <p>Para os produtos cerâmicos de cor clara, é preciso usar areia com baixo teor de ferro.</p>
</div>
<p>Além dos três minerais descritos anteriormente, diversos outros componentes são usados na produção de cerâmicas, tais como: os fundentes - bórax <span class="nobreak">(Na<sub>2</sub>B<sub>4</sub>O<sub>7</sub>·10H<sub>2</sub>O)</span>; barrilha <span class="nobreak">(Na<sub>2</sub>CO<sub>3</sub>)</span>; fluorita <span class="nobreak">(CaF<sub>2</sub>)</span>; óxido de chumbo; óxido de ferro; dentre outros e os refratários - alumina <span class="nobreak">(Al<sub>2</sub>O<sub>3</sub>)</span>; magnesita <span class="nobreak">(MgCO<sub>3</sub>)</span>; calcário <span class="nobreak">(CaCO<sub>3</sub>)</span>; dolomita <span class="nobreak">(CaMg(CO<sub>3</sub>)<sub>2</sub>)</span>; dentre outros.</p>

<h3>3.1.3. Processos de conversão química</h3>
<p>Basicamente todos os produtos cerâmicos são feitos pela combinação de quantidades adequadas dos componentes anteriormente citados. No entanto, para que esses materiais adquiram as características necessárias é preciso realizar o aquecimento dos mesmos até a temperatura de queima. Essas temperaturas podem variar de 700 a 2000 ºC e são responsáveis por várias reações químicas que constituem a base das seguintes reações: </p>
<div class="indentacao">
    <p><span class="bold">I. </span>Desidratação ou perda de água de cristalização (150 - 650 ºC);
        <br><span class="bold">II. </span>Calcinação (600 - 900 ºC);
        <br><span class="bold">III. </span>Oxidação do ferro(II) e da matéria orgânica (350 - 900 ºC);
        <br><span class="bold">IV. </span>Formação de silicatos (> 900 ºC);
    </p>
</div>
<p>Para exemplificar essas conversões as principais reações químicas que ocorrem durante o aquecimento da caulinita (que é uma das argilas mais usada na produção de materiais cerâmicos) é mostrado na eq. 3.2. </p>
<p>O primeiro efeito do calor é a eliminação da água de hidratação, que ocorre nas temperaturas entre 600 e 650 ºC. Esse processo é bastante endotérmico e gera um resíduo amorfo de alumina e sílica:</p>
<!-- ESTEQUIOMETRIA 3.2 SERÁ IMAGEM OU CÓDIGO? -->
<!-- (isabela) coloquei fórmula por enquanto -->
<div class="box-centro">
    <div class="formula pequena">
        <div class="line">
            <p>Al<sub>2</sub>O<sub>3</sub>·2SiO<sub>2</sub>·2H<sub>2</sub>O → Al<sub>2</sub>O<sub>3</sub> + 2SiO<sub>2</sub> + 2H<sub>2</sub>O</p>
            <span class="box-eq">equação 3.2</span>
        </div>
    </div>
</div>

<p>O aumento da temperatura (940 ºC) promove uma transformação da alumina amorfa em uma forma cristalina conhecida como γ-alumina, sendo esse segundo processo exotérmico. Em seguida, um pequeno aumento da temperatura, começando em torno de 1000 ºC promove a combinação da sílica com a alumina para formar a mulita <span class="nobreak">(3Al<sub>2</sub>O<sub>3</sub>·2SiO<sub>2)</span>. A uma temperatura ainda mais alta, a sílica remanescente é convertida a cristobalita cristalina. A reação química global para o aquecimento da argila é representada na eq. 3.3.</p>
<div class="box-centro">
    <div class="formula media">
        <div class="line">
            <p>3(Al<sub>2</sub>O<sub>3</sub>·2SiO<sub>2</sub>·2H<sub>2</sub>O) → 3Al<sub>2</sub>O<sub>3</sub>·2SiO<sub>2</sub> + 4SiO<sub>2</sub> + 6H<sub>2</sub>O</p>
            <span class="box-eq">equação 3.3</span>
        </div>
    </div>
</div>

<p>A presença de compostos fundentes tende a baixar a temperatura de formação da mulita.</p>
<p>Na prática, uma massa cerâmica real contém muito mais ingredientes e, portanto, as reações químicas envolvidas são muito mais complicadas, já que existirão outras espécies presentes no produto final. Assim, qualquer corpo cerâmico é composto por uma matriz vitrificada e cristais de mulita e cristobalita. Essa matriz vitrificada é formada pelo processo de vitrificação durante o aquecimento, e este grau de vitrificação depende das quantidades relativas de óxidos refratários e de óxidos fundentes presentes na composição, da temperatura e do tempo de aquecimento.</p>
<p>A fase de vitrificação é muito importante no processo de produção de materiais cerâmicos, uma vez que atua como ligante na porcelana e atribui-lhe transparência. Contudo, uma vitrificação muito intensa destrói a qualidade dos refratários. </p>
<p>A partir do grau de vitrificação, ou a progressiva redução da porosidade, é possível classificar os produtos cerâmicos conforme a seguinte lista:</p>
<ul class="indentacao">
    <li> Diversos graus de vitrificação: cerâmicas brancas;</li>
    <li> Pouca vitrificação: produtos estruturais de cerâmica, também conhecidos como cerâmica vermelha e refratários;</li>
    <li> Vitrificação completa: esmaltes e vidros.</li>
</ul>

