<h2 id="3.2">3.2. Indústria de cimento</h2>
<h3>3.2.1. Introdução</h3>
<p>O cimento é um material cerâmico que, em contato com a água, produz uma reação exotérmica de cristalização de produtos hidratados, ganhando assim resistência mecânica. A palavra cimento é originada do latim <em>caementu</em>, que designava na velha Roma uma espécie de pedra natural de rochedos não esquadrejada. A origem do cimento remonta há cerca de 4500 anos. Os imponentes monumentos do Egito antigo já utilizavam uma liga constituída por uma mistura de gesso calcinado. As grandes obras gregas e romanas, como o Panteão e o Coliseu, foram construídas com o uso de solos de origem vulcânica da ilha grega de Santorino ou das proximidades da cidade italiana de Pozzuoli, que possuíam propriedades de endurecimento sob a ação da água. O grande passo no desenvolvimento do cimento foi dado em 1756 pelo inglês John Smeaton, que conseguiu obter um produto de alta resistência por meio de calcinação de calcários moles e argilosos. Em 1818, o francês Vicat obteve resultados semelhantes aos de Smeaton, pela mistura de componentes argilosos e calcários. Ele é considerado o inventor do cimento artificial. Em 1824, o construtor inglês Joseph Aspdin queimou conjuntamente pedras calcárias e argila, transformando-as num pó fino. Percebeu que obtinha uma mistura que, após secar, tornava-se tão dura quanto às pedras empregadas nas construções. A mistura não se dissolvia em água e foi patenteada pelo construtor no mesmo ano, com o nome de cimento Portland, que recebeu esse nome por apresentar cor e propriedades de durabilidade e solidez semelhantes às rochas da ilha britânica de Portland.</p>
<p>No Brasil, a primeira tentativa de aplicar os conhecimentos relativos à fabricação do cimento Portland ocorreu aparentemente em 1888, quando o comendador Antônio Proost Rodovalho empenhou-se em instalar uma fábrica em sua fazenda em Santo Antônio, em São Paulo. Posteriormente, várias iniciativas esporádicas de fabricação de cimento foram desenvolvidas, como a pequena instalação produtora que chegou a funcionar durante três meses em 1892 na ilha de Tiriri, na Paraíba e a usina de Rodovalho que operou de 1897 a 1904, voltando em 1907 e extinguindo-se definitivamente em 1918. Em Cachoeiro do Itapemirim, o governo do Espírito Santo fundou, em 1912, uma fábrica que funcionou até 1924, sendo então paralisada, e voltando a funcionar em 1936, após modernização.</p>
<p>Todas essas etapas não passaram de meras tentativas que culminaram, em 1924, com a implantação, pela Companhia Brasileira de Cimento Portland, de uma fábrica em Perus, município localizado no Estado de São Paulo, cuja construção pode ser considerada como o marco da implantação da indústria brasileira de cimento. As primeiras toneladas foram produzidas e colocadas no mercado em 1926. Até então, o consumo de cimento no país dependia exclusivamente do produto importado. A produção nacional foi gradativamente elevada com a implantação de novas fábricas e a participação de produtos importados oscilou durante as décadas seguintes, até praticamente desaparecer nos dias de hoje.</p>

<h3>3.2.2. Processos de produção do cimento </h3>
<p>O processo de fabricação do cimento se inicia com a extração das matérias-primas, calcário e argila, das pedreiras de exploração, as quais devem conter em suas jazidas, em determinadas proporções, cálcio, sílica, alumínio e ferro. Contudo, normalmente é necessário corrigir a concentração de um ou dois destes elementos. Cada fábrica tem necessidade de correções diferentes em função das pedreiras existentes.</p>
<p>A extração é feita, habitualmente por meio de explosões para obter-se blocos com dimensão inferior a 0,5 m<sup>3</sup>. A matéria extraída é reduzida em britadores de martelos conforme mostra a Figura 3.1, com o propósito de se obter material cuja dimensão seja inferior a 9 cm. Ao mesmo tempo em que se efetua a redução, é feita a correção da mistura para que se aproxime da composição química desejada.</p>
