81,3.81,0,0,1,2.3-.61h1.1v-.52a1.41,1.41,0,0,0-.37-1.08,1.66,1.66,0,0,0-1.12-.32,6.33,6.33,0,0,0-1.91.38l-.31-.91a7.22,7.22,0,0,1,2.45-.48,2.54,2.54,0,0,1,1.87.61,2.32,2.32,0,0,1,.62,1.74v3.25A1.1,1.1,0,0,0,106.8,450.57Zm-1.38-.85v-1.63h-.93c-1.31,0-2,.48-2,1.45a1.34,1.34,0,0,0,.31,1,1.24,1.24,0,0,0,.92.32A1.87,1.87,0,0,0,105.42,449.72Z"></path><path d="M112.3,444.53a4.13,4.13,0,0,1,1.1.61l-.53.78a4.15,4.15,0,0,0-.92-.46,2.82,2.82,0,0,0-.92-.15,1.63,1.63,0,0,0-1,.25.8.8,0,0,0-.35.68.78.78,0,0,0,.33.67,3.81,3.81,0,0,0,1.19.48,4.22,4.22,0,0,1,1.78.8,1.76,1.76,0,0,1,.58,1.4,1.83,1.83,0,0,1-.81,1.61,3.55,3.55,0,0,1-2,.55,3.92,3.92,0,0,1-2.68-.93l.66-.76a3.21,3.21,0,0,0,2,.69,1.83,1.83,0,0,0,1.11-.29.9.9,0,0,0,.42-.79,1,1,0,0,0-.15-.58,1.19,1.19,0,0,0-.51-.39,8.14,8.14,0,0,0-1.07-.36,3.64,3.64,0,0,1-1.63-.79,1.7,1.7,0,0,1-.51-1.27,1.64,1.64,0,0,1,.33-1,2.12,2.12,0,0,1,.92-.7,3.22,3.22,0,0,1,1.31-.25A4.14,4.14,0,0,1,112.3,444.53Z"></path></g></svg>
